How to return Objects with empty sub Array document if sub Array documents don't satisfy the match condition?<p>Mongoose is not returning Objects if sub Array documents don't satisfy the match condition in mongoose.</p>

<p><strong>MongoDB Query:</strong></p>

<pre class="lang-js prettyprint-override"><code>db.fruits.aggregate(        
    { $match: { "isActive": true, fruitId: "kipld" } },
    { $unwind: '$types' },
    { $match: { "types.isActive": true } },
    { $group: {
            _id: '$_id', 
            name: {$first: '$name'}, 
            price: { $first: '$price' },
            types : { $push : '$types' }
        }
    },
    { $project: {
            '_id': 1, 
            'name':1, 
            'price': 1, 
            'types': 1,
        }
    }
)
</code></pre>

<p><strong>MongoDB Collection:</strong></p>

<pre><code>{
    _id: "abcdefg",
    fruitId: "kipld",
    isActive: true,
    types :[
        {
            name: "Kashmir Apple",
            price: 90,
            isActive: false
        },
        {
            name: "American Apple",
            price: 120,
            isActive: false
        }
    ]
}
</code></pre>

<p><strong>Expected result will be like:</strong></p>

<pre><code>{
    _id: "abcdefg",
    fruitId: "kipld",
    isActive: true,
    types :[]
}
</code></pre>

<p>But when I'm running the above query I'm not getting anything.</p>

